import Select from 'react-select'

export default function Testing() {

    const [testinglist, settestinglist] = useState([{}])


    const options = [
        { value: 'chocolate', label: 'Chocolate' },
        { value: 'strawberry', label: 'Strawberry' },
        { value: 'vanilla', label: 'Vanilla' }
      ]

      useEffect(()=>{
        fetch('https://f3bzwuya7a444klvzuesn2ihje0ipkjr.lambda-url.ap-east-1.on.aws/')
            .then(response => response.json())
            .then(data => settestinglist(data))
        },[])

  return (
    <div>
    <Select options={options} isMulti className="basic-multi-select"/>
    </div>
  )
}
